import React from 'react';
import Button from '@mui/material/Button';
import Stack from '@mui/material/Stack';
import WhatsAppIcon from './assets/wspp.svg'; 


function Portada() {
  return (
    <Stack direction="row" spacing={2}>
    <Button variant="contained" endIcon={<img src={WhatsAppIcon} alt="WhatsApp Icon" />}>
      Contactame
    </Button>
    </Stack>
  );
}

export default Portada;
